import React, { Component } from "react";
import axios from "axios";

export class App extends Component {
  constructor() {
    super();
    this.state = {
      persons: []
    };
  }

  componentDidMount() {
    axios.get(`https://jsonplaceholder.typicode.com/comments`).then(res => {
      const persons = res.data;
      console.log(persons);
      this.setState({ persons });
    });
  }
  renderTable() {
    return this.props.car_expenses.map(car => {
      return (
        <tbody key={car.id}>
          <td>{car.time}</td>
          <td>{car.name.label}</td>
          <td>{car.value}Eur </td>
          <td>
            <button onClick={() => this.deleteCar(car.id)} className="erase">
              Istrinti
            </button>
          </td>
        </tbody>
      );
    });
  }
  render() {
    console.log(this.state.persons.name);
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Data</th>
              <th>Islaidos uz</th>
              <th>Kaina</th>
              <th>Redaguoti</th>
            </tr>
          </thead>
          {renderTable()}
        </table>
        <ul>
          {this.state.persons.map(person => (
            <li>{person.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default App;
